(() => {
  const IMAGE_DATA =
    "data:image/png;base64,";

  const createImage = () => {
    const image = document.createElement("img");
    image.src = IMAGE_DATA;
    Object.assign(image.style, {
      position: "fixed",
      zIndex: Number.MAX_SAFE_INTEGER,
      pointerEvents: "none",
      visibility: "hidden"
    });

    return image;
  };

  let lastCoords = null;

  const showImage = image =>
    window.requestAnimationFrame(() => {
      image.style.visibility = "visible";
    });

  const hideImage = image =>
    window.requestAnimationFrame(() => {
      image.style.visibility = "hidden";
    });

  const moveImage = (image, x, y) =>
    window.requestAnimationFrame(() => {
      image.style.top = `${y - 20}px`;
      image.style.left = `${x - 45}px`;
    });

  const handleMouseMove = ({ clientX, clientY }) => {
    moveImage(img, clientX, clientY);
    if (!lastCoords) return;

    const { x, y } = lastCoords;
    window.scrollBy((x - clientX) * 2, (y - clientY) * 2);
    lastCoords = { x: clientX, y: clientY };
  };

  const handleMouseUp = ({ clientX, clientY }) => {
    lastCoords = null;
  };

  const handleMouseDown = ({ clientX: x, clientY: y }) => {
    lastCoords = { x, y };
  };

  handlers = {
    mousemove: handleMouseMove,
    mouseup: handleMouseUp,
    mousedown: handleMouseDown
  };

  const addListeners = () =>
    Object.keys(handlers).forEach(eventType =>
      document.addEventListener(eventType, handlers[eventType])
    );

  const removeListeners = () =>
    Object.keys(handlers).forEach(eventType =>
      document.removeEventListener(eventType, handlers[eventType])
    );

  const enable = () => {
    document.body.style.cursor = "none";
    document.body.style.userSelect = "none";
    addListeners();
    showImage(img);
  };

  const disable = () => {
    document.body.style.cursor = "auto";
    document.body.style.userSelect = "auto";
    removeListeners();
    hideImage(img);
  };

  const img = createImage();

  let enabled = false;

  window.addEventListener("mouseTouchToggle", () => {
    enabled = !enabled;

    if (enabled) {
      document.body.appendChild(img);
      enable();
    } else {
      disable();
      img.remove();
    }
  });
})();
